pragma solidity 0.8.17;

interface IDAOOld1 {

  struct Premium {
      address subscriber;
      string flightNumber;
      uint128 amount;
      uint128 price;
      uint256 validUntil;
      bool contracted;
      bool executed;
  }

  function read() external view returns (uint256);

  function write(uint256 newValue) external;

  function getMinAmount() external view returns (uint256);

  function getMaxAmount() external view returns (uint256);

  function createPremium(string calldata _flightNumber, uint128 _amount) external;

  function setPremiumPrice(uint256 _premiumID, uint128 _price) external;

  function getPremium(uint256 _premiumID) external view returns (Premium memory);

  function contractPremium(uint256 _premiumID) payable external;

}


contract OracleOld1 {

  struct Request {
    address fromAddress;
    uint256 fromID;
    string fromFlightNumber;
    uint128 fromAmount;
  }
  Request[] requests;

  function estimateRisk(uint256 _requestID, string calldata _flightNumber, uint128 _amount) external {
    // calculate risk and return premium price to proceed (IA)
    // store info with dao address
    // call setPremiumPrice on DAO
    // updateFlightInfos(_requestID)
    Request memory request;
    request.fromAddress = msg.sender;
    request.fromID = _requestID;
    request.fromFlightNumber = _flightNumber;
    request.fromAmount = _amount;
    requests.push(request);
    fullfillRisk(requests.length - 1, 1);
  }
  function fullfillRisk(uint256 _requestID, uint256 _risk) public {
    Request memory request = requests[_requestID];
    // IDAOOld1(request.fromAddress).setPremiumPrice(request.fromID, request.fromAmount * _risk / 100);
    IDAOOld1(request.fromAddress).setPremiumPrice(request.fromID, 10);
  }

  function subscribe(string calldata _flightNumber) external {
    // subscibe to flight infos using chainlink
  }

  function updateFlightInfos(uint256 _requestID, bool _canceled) external {
    // chainlink call this method once time arrived

    // if flight was not canceled : STOP

    // else : call DAO method to tell it to refund users
  }
}
